  \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-ph-alkalinity-temperac752a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108122 includes chemical,
  discrete sample, meteorological, physical, profile and underway - surface data collected
  from MIRAI in the Coral Sea, South Pacific Ocean and Tasman Sea from 2003-08-03
  to 2003-10-16 and retrieved during cruise 49NZ03K04_2), 49NZ20030803, 49NZ20030803
  (49NZ03K04_1, 49NZ20030909 (49NZ03K04_1, 49NZ20030909 (49NZ03K04_2 and PCM09). These
  data include AIR TEMPERATURE, ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE -
  AIR, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), Cesium-137, DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial pressure
  (or fugacity) of carbon dioxide, Potential temperature (theta), SALINITY, SEA SURFACE
  TEMPERATURE, SIGMA-T, SILICATE, TRITIUM, Total Organic Carbon (TOC), WATER TEMPERATURE,
  WIND DIRECTION, WIND SPEED and pH. The instruments used to collect these data include
  Alkalinity titrator, CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC
  measurement, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement, Spectrophometer for pH measrement and bottle. These data were collected
  by Akihiko Murata, Masao Fukasawa and Shuichi Watanabe of Japan Agency for Marine-Earth
  Science and Technology (Jamstec) as part of the CLIVAR_P06EW_2003 (BEAGLE 2003)
  Legs 1, 2, 49NZ03K04_1, PCM09 and CLIVAR_P06_2003 (BEAGLE 2003) Underway PCO2 data
  set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
